import React,{Component} from "react";

class User extends Component{
    onDeleteClick(e){
        console.log("Clicked");
    }
    render(){
        const {id,name,email} = this.props;
        return(
            <tr>
                <td>{id}</td>
                <td>{name}</td>
                <td>{email}</td>
                <td>
                    <button onClick={this.onDeleteClick} className="btn btn-danger">Delete</button>
                </td>
            </tr>
        );
    }
}
export default User;
